all_2.query:
q = load "${App.Datasets.Leads_Data_v4_tp.FullyQualifiedName}";
q = filter q by 'Lead_Status__c' == "Lead";
q = filter q by 'Created_Date__c' > "2017-08-12T05:46:57.230+00:00";
q = group q by ('isParent__c', 'Gender__c');
q = foreach q generate 'isParent__c' as 'isParent__c', 'Gender__c' as 'Gender__c', count() as 'count';
q = order q by ('isParent__c' asc, 'Gender__c' asc);
q = limit q 2000;
